import "./MapLayer.css";

import { MapContainer, Polyline, TileLayer } from "react-leaflet";
import statesData from "./USAStates.js";
import { Polygon } from "leaflet";

const MapLayer = () => {
  return (
    <MapContainer center={[37.8, -96]} zoom={4} scrollWheelZoom={true}>
      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />

      {<Polygon positions={statesData.features[0].geometry.coordinates}/>}

{map((feature) => (
        <Polygon key={feature.id} positions={feature.geometry.coordinates.flat()} />
      ))}
    </MapContainer>
  );
};

export default MapLayer;
